import React, { useState } from 'react';
import { Icon } from '@iconify/react';
import { useNavigate } from 'react-router-dom';
import Slider from 'react-slick';
import SectionHeading from './SectionHeading';
import Modal from './Modal';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import './Projects.css';

const data = {
  sectionHeading: {
    miniTitle: "Showcase",
    title: "Recent Projects",
  },
  allProjects: [
    {
      id: "website-design",
      title: "Website Designing",
      subTitle: "Multi-column layout with hero image",
      thumbUrl: "\public\images\web design.jpg", // Direct path from public folder
      description: "A multi-column, flexbox-based page layout and hero image with a tinted overlay.",
    },
    {
      id: "snazzy-fashion",
      title: "Snazzy Fashion",
      subTitle: "Fashion video background",
      thumbUrl: "/images/snazzy-fashion.jpg",
      description: "A web page for a fashion retailer with a background video that plays in a continuous loop.",
    },
    {
      id: "hero-block-gallery",
      title: "Hero Block Gallery",
      subTitle: "Split-screen duotone hero blocks",
      thumbUrl: "/images/hero-block-gallery.jpg",
      description: "A gallery of hero block elements with split-screen layouts and duotone images.",
    }
  ]
};

export default function Projects() {
  const [modal, setModal] = useState(false);
  const [modalData, setModalData] = useState({});
  const navigate = useNavigate();
  const { sectionHeading, allProjects } = data;

  const handelProjectDetails = (item, itemType) => {
    if (itemType === 'image') {
      setModalData(item);
      setModal(true);
    } else if (itemType === 'details') {
      navigate(`/project/${item.id}`);
    }
  };

  const sliderSettings = {
    dots: true,
    arrows: false,
    infinite: true,
    autoplay: false,
    speed: 1000,
    slidesToShow: 1,
    slidesToScroll: 1,
    variableWidth: true,
  };

  return (
    <>
      <section className="projects-section section gray-bg" id="project">
        <div className="container">
          <SectionHeading
            miniTitle={sectionHeading.miniTitle}
            title={sectionHeading.title}
          />
          <div className="full-width">
            <Slider {...sliderSettings} className="slider-gap-24">
              {allProjects.map((item, index) => (
                <div key={index} style={{ width: '416px' }}>
                  <div className="project-box">
                    <div className="project-media">
                      <img src={item.thumbUrl} alt={item.title} />
                      <span
                        className="gallery-link"
                        onClick={() => handelProjectDetails(item, 'image')}
                      >
                        <i><Icon icon="bi:plus" /></i>
                      </span>
                    </div>
                    <div className="project-body">
                      <div className="text">
                        <h5>{item.title}</h5>
                        <span>{item.subTitle}</span>
                      </div>
                      <div className="link">
                        <span
                          className="p-link"
                          onClick={() => handelProjectDetails(item, 'details')}
                        >
                          <Icon icon="bi:arrow-right" />
                        </span>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </Slider>
          </div>
        </div>
      </section>

      {modal && (
        <div className="mfp-wrap">
          <div className="mfp-container">
            <div className="mfp-bg" onClick={() => setModal(false)}></div>
            <div className="mfp-content">
              <button
                type="button"
                className="mfp-close"
                onClick={() => setModal(false)}
              >
                ×
              </button>
              <img src={modalData.thumbUrl} alt={modalData.title} />
              <h3>{modalData.title}</h3>
              <p>{modalData.description}</p>
            </div>
          </div>
        </div>
      )}
    </>
  );
}
